import React, { useEffect, useState } from 'react';
import Building5Map from '../components/building-5-map.js';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

function Building5() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch(`http://127.0.0.1:5000/api/kennel/start=1&end=24`);
      // console.log(response);
      const newData = await response.json();
      // console.log(newData);
      setData(newData);
    };
  
    fetchData();
  }, []);

  if(data) console.log(data);

  const currentUrl = window.location.href;
  const lastPartOfUrl = currentUrl.substring(currentUrl.lastIndexOf('/') + 1);
  console.log(lastPartOfUrl);
  const kennelId = lastPartOfUrl.startsWith('kennel=') ? lastPartOfUrl.substring(7) : null;
  console.log(kennelId);
  // console.log(currentUrl);

  return (
    <div className="Building-5">
      <Building5Map />
      {window.location.href.substring(currentUrl.lastIndexOf('/') + 1).startsWith('kennel=') ? 
      <div className="KennelInfo">
      <Card style={{ width: '18rem' }}>
        <Card.Img variant="top" src="holder.js/100px180" />
        <Card.Body>
          <Card.Title>Kennel {lastPartOfUrl.substring(7)}</Card.Title>
          <Card.Text>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>
    </div>
      : null}
    </div>
  );
}

export default Building5;
